import React from "react";
import NameIntro from "./components/nameintro";
import LatestArticle from "./components/latestarticle";

function App() {
  return (
    <React.Fragment>
      <div>
        <NameIntro />
      </div>
      <LatestArticle />
    </React.Fragment>
  );
}

export default App;
